    //           (result) => {
    //             if (result.isConfirmed) {
    //               window.location.href = `/admin?email=${email}`;
    //             }
    //           }
    //         );
    //       } else {
    //         Swal.fire("Oops!", "Failed to add course", "error").then((result) => {
    //           if (result.isConfirmed) {
    //             window.location.href = `/admin?email=${email}`;
    //           }
    //         });
    //       }
    //     })
    //     .catch((error) => {
    //       console.error("Error:", error);
